INSERT INTO `anion_voice_script` (`id`, `phase`, `f6`, `f7`, `match_id`, `script`) VALUES
(1,	'1',	NULL,	NULL,	NULL,	'Witaj w nowej analizie anionów! W przypadku stwierdzenia w roztworze kationów barwnych, czyli: miedzi, niklu, kobaltu, żelaza czy chromu, oraz kationów ulegających łatwo hydrolizie z wytworzeniem trudno rozpuszczalnych osadów czyli: bizmutu oraz antymonu. Należy je wytrącić przez dodanie odpowiedniej ilości roztworu węglanu sodu. Powstały osad odsączyć a przesącz zakwasić kwasem azotowym. '),
(2,	'2',	'1',	'end',	',1,',	'Ciemnofiołkowy płyn wskazuje na obecność w analizowanym roztworze jedno ujemnego anionu tetraoksydomanganianu'),
(3,	'2',	'2',	'end',	',2,',	'Żółty płyn wskazuje na obecność w analizowanym roztworze dwu ujemnego anionu chromianowego'),
(4,	'2',	'3',	'end',	',3,',	'Pomarańczowy płyn wskazuje na obecność w analizowanym roztworze dwu ujemnego anionu dichromianowego'),
(5,	'2',	NULL,	NULL,	',4,5,6,7,8,9,10,11,12,',	'W celu dalszej analizy należy próbkę pierwotną zadać roztworem azotanu srebra'),
(6,	'3',	NULL,	NULL,	',4,5,6,7,8,11,12,',	'W celu dalszej analizy należy próbkę pierwotną zadać roztworem chlorku baru'),
(7,	'3',	NULL,	NULL,	',9,10,',	'W celu dalszej analizy należy powstały osad zadać wodą amoniakalną'),
(8,	'4',	'4',	'end',	',4,',	'Brak osadu wskazuje na obecność w analizowanym roztworze jedno ujemnego anionu azotanowego'),
(9,	'4',	'5',	'end',	',5,',	'Biały osad wskazuje na obecność w analizowanym roztworze dwu ujemnego anionu siarczanowego'),
(10,	'4',	'6',	'end',	',6,',	'Brak osadu wskazuje na obecność w analizowanym roztworze jedno ujemnego anionu chlorkowego'),
(11,	'4',	'7',	'end',	',7,',	'Biały osad wskazuje na obecność w analizowanym roztworze dwu ujemnego anionu węglanowego'),
