(16,	'5',	'11',	'end',	',11,',	'Biały osad wskazuje na obecność w analizowanym roztworze jedno ujemnego anionu bromkowego'),
(17,	'5',	'12',	'end',	',12,',	'Żółty osad wskazuje na obecność w analizowanym roztworze jedno ujemnego anionu jodkowego');
INSERT INTO `anion_voice_script_en` (`id`, `phase`, `f6`, `f7`, `match_id`, `script`) VALUES
(1,	'1',	NULL,	NULL,	NULL,	'Welcome to the new anion analysis! If colored cations are found in the solution, i.e. copper, nickel, cobalt, iron or chromium, as well as easily hydrolysable cations with the formation of sparingly soluble precipitates, i.e. bismuth and antimony. They must be precipitated by adding an appropriate amount of sodium carbonate solution. The resulting precipitate is filtered off and the filtrate is acidified with nitric acid.'),
(2,	'2',	'1',	'end',	',1,',	'A dark purple liquid indicates the presence of the mononegative tetraoxidomanganate anion in the analysed solution.'),
(3,	'2',	'2',	'end',	',2,',	'A yellow liquid indicates the presence of binegative chromate anion in the analysed solution.'),
(4,	'2',	'3',	'end',	',3,',	'An orange liquid indicates the presence of the binegative dichromate anion in the analysed solution.'),
(5,	'2',	NULL,	NULL,	',4,5,6,7,8,9,10,11,12,',	'For further analysis, the primary sample should be treated with a solution of silver nitrate.'),
(6,	'3',	NULL,	NULL,	',4,5,6,7,8,11,12,',	'For further analysis, the primary sample should be treated with barium chloride solution.'),
(7,	'3',	NULL,	NULL,	',9,10,',	'For further analysis, the resulting precipitate should be treated with ammonia water.'),
(8,	'4',	'4',	'end',	',4,',	'The absence of a precipitate indicates the presence of a mononegative nitrate anion in the analysed solution.'),
(9,	'4',	'5',	'end',	',5,',	'A white precipitate indicates the presence of the binegative sulfate anion in the analysed solution.'),
(10,	'4',	'6',	'end',	',6,',	'The absence of a precipitate indicates the presence of a mononegative chloride anion in the analysed solution.'),
(11,	'4',	'7',	'end',	',7,',	'A white precipitate indicates the presence of a binegative carbonate anion in the analysed solution.'),
(12,	'4',	'8',	'end',	',8,',	'A white precipitate indicates the presence of the three-negative phosphate anion in the analysed solution.'),
(13,	'4',	'9',	'end',	',9,',	'The absence of a precipitate indicates the presence of a mononegative hydroxide anion in the analysed solution.'),
(14,	'4',	'10',	'end',	',10,',	'A black precipitate indicates the presence of a binegative sulfide anion in the analysed solution.'),
(15,	'4',	NULL,	NULL,	',11,12,',	'For further analysis, the primary sample should be treated with lead nitrate.'),
(16,	'5',	'11',	'end',	',11,',	'A white precipitate indicates the presence of a mononegative bromide anion in the analysed solution.'),
(17,	'5',	'12',	'end',	',12,',	'A yellow precipitate indicates the presence of one negative iodide anion in the analysed solution.');
